const HeaderLogo = () => {
    return ( 
        <NavLink to="/" className="link">
            <div className="logo-wrapper">
                <p className="logo-icon">
                    UX
                </p>
                <p className="logo-text">BardToyn</p>
                <span className="logo-circul"></span>
                <p className="logo-text">Portfolio</p>
            </div>
        </NavLink>
     );
}
 
export default HeaderLogo;
